import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom'


class App extends Component {

  render() {
    return (
      <div className="App">
        <Router>
          <React.Fragment>
          <NavBar />
          </React.Fragment>
        </Router>

          <h2><Heart /></h2>

      </div>
    );
  }
}

export default App;
